    and consist of the county or counties or equivalent entities associated with atn
                  least one urban core (urbanized area or urban cluster) of at least
    10,000 population,n               plus adjacent counties having a high degree of
    social and economic integration withn               the core as measured through
    commuting ties with the counties containing the core.n               Categories
    of CBSAs are: Metropolitan Statistical Areas, based on urbanized areas ofn               50,000
    or more population; and Micropolitan Statistical Areas, based on urbann               clusters
    of at least 10,000 population but less than 50,000 population. Economicn               Census
